def get_icon(name='phatch'):
    icon = wx.Icon()
    if sys.platform.startswith('win'):
        py = eval('ICON_%s_32' % name.upper())
    else:
        py = eval('ICON_%s_64' % name.upper())
    icon.CopyFromBitmap(graphics.bitmap(py))
    return icon


def set_icon(window, name='phatch'):
    window.SetIcon(get_icon(name))

def save_bytes(name):
    icon = eval(name)
    if icon[0:1] == b'x':  # compare first byte expect x to be zlib
        icon_b = zlib.decompress(icon)
    else:
        icon_b = icon

    filename = os.path.join(r'C:\Users\fires\Desktop\phatch_images', name)
    if icon_b[0:4] == b'\x89PNG':
        filename += '.png'
    else:
        print(str(icon[0:4]))

    with open(filename, 'wb') as f:
        f.write(icon_b)

class PhotoCtrl(wx.App):
    """
    Adapted from https://www.blog.pythonlibrary.org/2010/03/26/creating-a-simple-photo-viewer-with-wxpython/
    """
    def __init__(self, redirect=False, filename=None):
        wx.App.__init__(self, redirect, filename)
        self.frame = wx.Frame(None, title='Photo View')
        self.panel = wx.Panel(self.frame)

        self.create_widgets()
        self.frame.Show()

    def create_widgets(self):
        instructions = 'Select Image to Verify'

        wx_image = graphics.image(SPLASH)

        # img = Image.open(r'D:\source_code\phatch\tests\input\splash.png')
        # wx_image_sm = pil_wxImage(img)

        self.image_control = wx.StaticBitmap(self.panel, wx.ID_ANY,
                                             wx.Bitmap(wx_image))

        instructLbl = wx.StaticText(self.panel, label=instructions)

        self.comboSelect = wx.ComboBox(self.panel, style=wx.CB_DROPDOWN, value='SPLASH',
                                       choices=['LOGO', 'SPLASH', 'LOGO_INSPECTOR', 'DROPLET',
                                                'ICON_PHATCH_32', 'ICON_PHATCH_64', 'ICON_INSPECTOR_32',
                                                'ICON_INSPECTOR_64', 'ICON_INSPECTOR_96HIGH'])
        load_button = wx.Button(self.panel, label='Load')
        load_button.Bind(wx.EVT_BUTTON, self.onBrowse)

        self.mainSizer = wx.BoxSizer(wx.VERTICAL)
        self.sizer = wx.BoxSizer(wx.HORIZONTAL)

        self.mainSizer.Add(wx.StaticLine(self.panel, wx.ID_ANY),
                           0, wx.ALL | wx.EXPAND, 5)
        self.mainSizer.Add(instructLbl, 0, wx.ALL, 5)
        self.mainSizer.Add(self.image_control, 0, wx.ALL, 5)

        # self.sizer.Add(self.photoTxt, 0, wx.ALL, 5)
        self.sizer.Add(self.comboSelect, 0, wx.ALL, 5)

        self.sizer.Add(load_button, 0, wx.ALL, 5)
        self.mainSizer.Add(self.sizer, 0, wx.ALL, 5)

        self.panel.SetSizer(self.mainSizer)
        self.mainSizer.Fit(self.frame)
        self.panel.Layout()

    def onBrowse(self, event):
        """

        """
        image_name = self.comboSelect.GetValue()
        wx_image = graphics.image(eval(image_name))
        #save_bytes(image_name)

        self.image_control.SetBitmap(wx.Bitmap(wx_image))
        self.panel.Refresh()




